import{_ as e}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as p,c as t,f as a}from"./app.1218f0f6.js";const c={},o=a('<h1 id="\u7B2C29\u96C6-\u5468\u79C9\u6606\u667A\u9000\u5B59\u5C0F\u5B81" tabindex="-1"><a class="header-anchor" href="#\u7B2C29\u96C6-\u5468\u79C9\u6606\u667A\u9000\u5B59\u5C0F\u5B81" aria-hidden="true">#</a> \u7B2C29\u96C6\uFF1A\u5468\u79C9\u6606\u667A\u9000\u5B59\u5C0F\u5B81</h1><p>\u9A86\u58EB\u5BBE\u5B8C\u5168\u8D1F\u8D23\u5904\u7406\u62D4\u4E1D\u5382\u7684\u4E8B\u60C5\uFF0C\u8BA9\u6C34\u81EA\u6D41\u8E0F\u5B9E\u7684\u7559\u4E0B\u529E\u7406\u4ED6\u7684\u5934\u7B49\u5927\u4E8B\u3002</p><p>\u8D76\u8D85\u548C\u56FD\u5E86\u4E24\u4EBA\u8E72\u5B88\u5728\u5927\u8857\u4E0A\u7B49\u6D3B\uFF0C\u4E34\u65F6\u6709\u4EBA\u9700\u8981\u642C\u8FD0\u5DE5\u4E8C\u4EBA\u5C31\u8DDF\u7740\u53BB\uFF0C\u6070\u597D\u5468\u79C9\u6606\u53BB\u5175\u5DE5\u5382\u627E\u5468\u79C9\u4E49\u7684\u65F6\u5019\u770B\u5230\u4E8C\u4EBA\uFF0C\u8D76\u8D85\u8FD8\u4EE5\u4E3A\u5468\u79C9\u6606\u662F\u4E3A\u4E86\u56FD\u5E86\u7684\u5DE5\u4F5C\u95EE\u9898\u627E\u5468\u79C9\u4E49\u53BB\u5E2E\u5FD9\u3002</p><p>\u5468\u79C9\u6606\u6765\u7684\u65F6\u5019\uFF0C\u6070\u597D\u662F\u5468\u79C9\u4E49\u5728\u53EC\u5F00\u5168\u4F53\u5458\u5DE5\u5927\u4F1A\uFF0C\u5468\u79C9\u4E49\u7528\u5468\u79C9\u6606\u7684\u4E8B\u8FF9\u60F3\u8981\u53BB\u8BF4\u670D\u5927\u5BB6\u5931\u4E1A\u7684\u4E0D\u53EF\u6015\uFF0C\u4F46\u662F\u6CA1\u60F3\u5230\u5927\u5BB6\u90FD\u8BA4\u4E3A\u5468\u79C9\u6606\u4E00\u5B9A\u662F\u56E0\u4E3A\u6709\u4E86\u4ED6\u8FD9\u4E2A\u5F53\u5B98\u7684\u54E5\u54E5\uFF0C\u6240\u4EE5\u624D\u4F1A\u51FA\u4EBA\u5934\u5730\u3002\u8001\u4E66\u8BB0\u770B\u5468\u79C9\u4E49\u8BF4\u8BDD\u4E0D\u53D7\u5927\u5BB6\u559C\u6B22\uFF0C\u5E72\u8106\u5C31\u62A2\u4E86\u8BDD\u7B52\u63A5\u8FC7\u53BB\u8BB2\u8BDD\u3002\u6CA1\u60F3\u5230\u8FD9\u4E2A\u65F6\u5019\u5DE5\u5382\u91CC\u5374\u51FA\u4E8B\u4E86\uFF0C\u5DE5\u5382\u7684\u8001\u5DE5\u4EBA\u675C\u5FB7\u6D77\u8981\u81EA\u6740\uFF0C\u81EA\u6740\u4E4B\u524D\u70B9\u540D\u4E86\u8981\u89C1\u5468\u79C9\u4E49\u3002</p><p>\u675C\u5FB7\u6D77\u8EAB\u4E0A\u5E2E\u7740\u70B8\u836F\uFF0C\u70B9\u540D\u8981\u6C42\u5468\u79C9\u4E49\u4E00\u4E2A\u4EBA\u4E0A\u524D\uFF0C\u8001\u4E66\u8BB0\u63D0\u51FA\u4E00\u8D77\u4E0A\u524D\u4E5F\u88AB\u675C\u5FB7\u6D77\u62D2\u7EDD\u4E86\u3002\u675C\u5FB7\u6D77\u76F4\u63A5\u8BE2\u95EE\u5468\u79C9\u4E49\u6253\u7B97\u628A\u8FD9\u4E2A\u5382\u5B50\u5356\u7ED9\u65E5\u672C\u4EBA\u8FD8\u662F\u6E2F\u5546\uFF0C\u8FD8\u8868\u793A\u5408\u8D44\u548C\u8F6C\u4EA7\u4ED6\u90FD\u540C\u610F\uFF0C\u4F46\u662F\u575A\u51B3\u53CD\u5BF9\u5356\u5382\u5B50\u3002\u675C\u5FB7\u6D77\u5F3A\u8C03\u81EA\u5DF1\u662F\u7231\u56FD\u7684\u4EBA\uFF0C\u4ED6\u6253\u5FC3\u773C\u91CC\u611F\u8C22\u5382\u5B50\u91CC\u7684\u5E2E\u52A9\uFF0C\u56E0\u4E3A\u4ED6\u524D\u540E\u52A8\u8FC7\u51E0\u6B21\u5927\u624B\u672F\uFF0C\u90FD\u662F\u5382\u5B50\u91CC\u8D1F\u8D23\u7684\uFF0C\u800C\u4ED6\u7684\u75C5\u5C31\u662F\u4E00\u4E2A\u7EDD\u75C7\uFF0C\u4E5F\u662F\u65E0\u5E95\u6D1E\uFF0C\u6D3B\u4E0B\u53BB\u4E5F\u53EA\u80FD\u662F\u62D6\u7D2F\u5382\u5B50\u3002\u675C\u5FB7\u6D77\u8868\u793A\u81EA\u5DF1\u73B0\u5728\u8FD9\u79CD\u601D\u60F3\u8981\u4E0A\u62A5\u7ED9\u7EC4\u7EC7\uFF0C\u4ED6\u4E0D\u60F3\u6B7B\u4E86\u88AB\u4EBA\u6263\u4E0A\u4E00\u9876\u81EA\u7EDD\u4E8E\u515A\u548C\u4EBA\u6C11\u7684\u5E3D\u5B50\uFF0C\u90A3\u6837\u4E0D\u5229\u4E8E\u5BB6\u5EAD\u3002</p><p>\u5468\u79C9\u4E49\u5374\u4E0D\u79BB\u5F00\uFF0C\u575A\u6301\u8981\u548C\u675C\u5FB7\u6D77\u4E00\u8D77\u53BB\u6B7B\uFF0C\u675C\u5FB7\u6D77\u63D0\u9192\u5468\u79C9\u4E49\u4ED6\u7684\u6B7B\u53EF\u80FD\u8F7B\u4E8E\u9E3F\u6BDB\uFF0C\u4F46\u662F\u6700\u540E\u5468\u79C9\u4E49\u4E5F\u6CA1\u6709\u79BB\u5F00\u4E00\u6B65\uFF0C\u5468\u79C9\u6606\u6251\u8FC7\u53BB\u8981\u6551\u5468\u79C9\u4E49\uFF0C\u5374\u4E0D\u6210\u60F3\u675C\u5FB7\u6D77\u5230\u6700\u540E\u4E00\u79D2\u6254\u6389\u4E86\u70B8\u836F\uFF0C\u5468\u79C9\u6606\u88AB\u70B8\u836F\u6CE2\u53CA\u6454\u5012\u5728\u5730\uFF0C\u800C\u675C\u5FB7\u6D77\u4E5F\u6251\u5012\u4E86\u5468\u79C9\u4E49\u3002\u5468\u79C9\u6606\u607C\u6012\u5468\u79C9\u4E49\u7B80\u76F4\u5C31\u662F\u75AF\u4E86\uFF0C\u5468\u79C9\u4E49\u4E5F\u5FC3\u75BC\u5F1F\u5F1F\u5DEE\u70B9\u51FA\u4E8B\u3002\u5468\u79C9\u4E49\u4E0D\u653E\u5FC3\u5468\u79C9\u6606\uFF0C\u4E0B\u73ED\u4E4B\u540E\u5C31\u6765\u63A2\u671B\uFF0C\u5468\u79C9\u6606\u4F9D\u7136\u662F\u5FC3\u6709\u4F59\u60B8\uFF0C\u6CA1\u60F3\u5230\u4E00\u4E2A\u5382\u5B50\u8FD8\u5DEE\u70B9\u8981\u4E86\u4EBA\u547D\u3002\u5468\u79C9\u6606\u8B66\u544A\u5468\u79C9\u4E49\u4E0B\u6B21\u901E\u80FD\u4E4B\u524D\u6382\u91CF\u4E00\u4E0B\u81EA\u5DF1\u7684\u5206\u91CF\uFF0C\u5982\u679C\u518D\u6709\u4E00\u6B21\u4ED6\u5C31\u544A\u8BC9\u90DD\u51AC\u6885\u53BB\u3002</p><p>\u53D7\u5230\u4E86\u4F59\u6CE2\u9707\u8361\u7684\u5468\u79C9\u6606\u4E00\u9635\u9635\u7684\u6076\u5FC3\u60F3\u8981\u5455\u5410\uFF0C\u5413\u5F97\u5468\u79C9\u4E49\u8D76\u7D27\u62C9\u7740\u5468\u79C9\u6606\u53BB\u533B\u9662\uFF0C\u5468\u79C9\u6606\u8FD8\u4E0D\u505C\u7684\u8D23\u602A\u5468\u79C9\u4E49\u4E0D\u8BE5\u548C\u5916\u4EBA\u8BF4\u5F53\u5E74\u4E0D\u559C\u6B22\u90D1\u5A1F\u7684\u4E8B\u60C5\uFF0C\u90D1\u5A1F\u5F53\u5E74\u5AC1\u8FDB\u6765\u4E5F\u662F\u5927\u5BB6\u90FD\u8D5E\u540C\u4E86\u7684\u3002\u5468\u79C9\u4E49\u60F3\u8D77\u4E86\u548C\u59DA\u7ACB\u677E\u66FE\u7ECF\u8BF4\u8FC7\uFF0C\u4E00\u5F00\u59CB\u4E0D\u559C\u6B22\u90D1\u5A1F\u5E26\u7740\u5B69\u5B50\uFF0C\u4F46\u662F\u540E\u6765\u8FD8\u662F\u90FD\u63A5\u53D7\u4E86\uFF0C\u5468\u79C9\u4E49\u7406\u4E8F\u4E5F\u4E0D\u77E5\u9053\u5982\u4F55\u89E3\u91CA\u3002</p><p>\u5B59\u5C0F\u5B81\u5F97\u77E5\u5468\u79C9\u6606\u4F4F\u9662\u4E86\uFF0C\u98DE\u5954\u8D76\u53BB\u4E86\u533B\u9662\uFF0C\u5468\u79C9\u6606\u5728\u75C5\u623F\u91CC\u548C\u75C5\u53CB\u95F2\u804A\u3002\u90D1\u5A1F\u770B\u5230\u5B59\u5C0F\u5B81\u8FC7\u6765\u6CA1\u6709\u7740\u6025\u8FDB\u53BB\u75C5\u623F\uFF0C\u800C\u662F\u7AD9\u5728\u4E86\u95E8\u5916\u3002\u5468\u79C9\u6606\u8C0E\u79F0\u90A3\u5929\u90D1\u5A1F\u6765\u4E66\u5E97\u627E\u4ED6\u662F\u56E0\u4E3A\u90D1\u5149\u660E\u7684\u4E8B\u60C5\uFF0C\u5728\u5468\u79C9\u6606\u7684\u53E3\u4E2D\uFF0C\u90D1\u5A1F\u662F\u4E00\u4E2A\u975E\u5E38\u8BC6\u5927\u4F53\u7684\u4EBA\uFF0C\u4E0D\u613F\u610F\u56E0\u4E3A\u5979\u5A18\u5BB6\u7684\u4E8B\u60C5\u800C\u627E\u5468\u79C9\u4E49\u5E2E\u5FD9\uFF0C\u4F46\u662F\u5468\u79C9\u6606\u548C\u5BB6\u4EBA\u5374\u4E0D\u80FD\u4E0D\u5728\u4E4E\u90D1\u5A1F\u7684\u611F\u53D7\uFF0C\u90D1\u5A1F\u5C31\u662F\u5168\u5BB6\u4EBA\u7684\u4E3B\u5FC3\u9AA8\u548C\u9876\u6881\u67F1\uFF0C\u6B63\u662F\u56E0\u4E3A\u5982\u6B64\uFF0C\u4ED6\u624D\u7792\u7740\u90D1\u5A1F\u53BB\u627E\u5468\u79C9\u4E49\uFF0C\u7ED3\u679C\u5C31\u51FA\u4E8B\u4E86\u3002</p><p>\u5468\u79C9\u6606\u5BE5\u5BE5\u6570\u8BED\u8BF4\u660E\u4E86\u90D1\u5A1F\u65E0\u53EF\u66FF\u4EE3\u7684\u4F4D\u7F6E\uFF0C\u4E5F\u8BA9\u5B59\u5C0F\u5B81\u77E5\u96BE\u800C\u9000\uFF0C\u5B59\u5C0F\u5B81\u5306\u5FD9\u544A\u8F9E\u79BB\u5F00\uFF0C\u800C\u7AD9\u5728\u95E8\u5916\u7684\u90D1\u5A1F\u4E5F\u611F\u52A8\u843D\u6CEA\u4E86\u3002\u90D1\u5A1F\u4E3B\u52A8\u5C06\u624B\u7EE2\u9012\u7ED9\u5B59\u5C0F\u5B81\uFF0C\u4E5F\u76F8\u4FE1\u5B59\u5C0F\u5B81\u80FD\u627E\u5230\u66F4\u597D\u7684\uFF0C\u5B59\u5C0F\u5B81\u63E1\u7740\u90D1\u5A1F\u7684\u624B\uFF0C\u79F0\u8D5E\u90D1\u5A1F\u7684\u547D\u597D\u3002\u90D1\u5A1F\u548C\u5468\u79C9\u6606\u7684\u5FC3\u7ED3\u89E3\u5F00\uFF0C\u5468\u79C9\u6606\u5E0C\u671B\u4EE5\u540E\u90D1\u5A1F\u4E0D\u7BA1\u4EC0\u4E48\u4E8B\u90FD\u544A\u8BC9\u4ED6\uFF0C\u5468\u79C9\u6606\u63E1\u7740\u90D1\u5A1F\u7684\u624B\u4E00\u76F4\u79F0\u8D5E\u597D\u770B\uFF0C\u5E76\u8BF4\u7740\u5BF9\u4E0D\u8D77\u3002\u90D1\u5A1F\u89C9\u5F97\u81EA\u5DF1\u7684\u624B\u96BE\u770B\u60F3\u8981\u7F29\u56DE\u6765\uFF0C\u53EF\u662F\u5468\u79C9\u6606\u6293\u7740\u4E0D\u653E\u624B\uFF0C\u5728\u4ED6\u7684\u773C\u4E2D\u90D1\u5A1F\u7684\u624B\u624D\u662F\u6700\u597D\u770B\u7684\u3002</p><p>\u90D1\u5A1F\u548C\u5468\u79C9\u6606\u5546\u8BAE\u5356\u623F\u5B50\u7684\u4E8B\u60C5\uFF0C\u60F3\u8981\u5E2E\u7740\u90D1\u5149\u660E\u89E3\u51B3\u71C3\u7709\u4E4B\u6025\uFF0C\u4F46\u662F\u90D1\u5A1F\u5BB6\u91CC\u7684\u623F\u5B50\u8D76\u8D85\u4F4F\u7740\uFF0C\u5468\u79C9\u6606\u5BB6\u91CC\u7684\u623F\u5B50\u56FD\u5E86\u4F4F\u7740\uFF0C\u76EE\u524D\u8C01\u4E5F\u4E0D\u80FD\u8D76\u8D70\uFF0C\u4E5F\u4E0D\u80FD\u5356\u3002\u4F46\u662F\u4E24\u4EBA\u65B0\u4E70\u4E86\u8FD9\u4E2A\u623F\u5B50\uFF0C\u4E5F\u6CA1\u6709\u591A\u4F59\u7684\u94B1\u6765\u7ED9\u90D1\u5149\u660E\uFF0C\u4E00\u65F6\u4E4B\u95F4\u72AF\u96BE\u4E86\u3002</p><p>\u90DD\u6BCD\u548C\u90DD\u51AC\u6885\u4E5F\u77E5\u9053\u4E86\u5468\u79C9\u4E49\u7684\u4E8B\u60C5\uFF0C\u4E24\u4EBA\u90FD\u63EA\u7740\u5FC3\uFF0C\u6BD5\u7ADF\u662F\u548C\u5E73\u5E74\u4EE3\uFF0C\u80FD\u53D1\u751F\u8FD9\u6837\u7684\u4E8B\u60C5\u8FD8\u662F\u6BD4\u8F83\u9707\u60CA\u7684\u3002\u90DD\u51AC\u6885\u8981\u6C42\u5468\u79C9\u4E49\u7ACB\u523B\u79BB\u5F00\u5175\u5DE5\u5382\uFF0C\u4F46\u662F\u90DD\u6BCD\u5374\u5206\u6790\u73B0\u5728\u7684\u5DE5\u4EBA\u6025\u9700\u8981\u4EC0\u4E48\uFF0C\u5F53\u52A1\u4E4B\u6025\u5C31\u662F\u89E3\u51B3\u7528\u7164\u95EE\u9898\u3002\u90DD\u6BCD\u5C06\u50A8\u5B58\u7684\u4E09\u4E07\u5143\u7ED9\u4E86\u5468\u79C9\u4E49\uFF0C\u8BA9\u4ED6\u5148\u7528\u8FD9\u7B14\u6B3E\u53BB\u89E3\u51B3\u95EE\u9898\u3002\u56E0\u4E3A\u7164\u662F\u4E13\u7528\u7684\u4E1C\u897F\uFF0C\u4E0D\u80FD\u7528\u516C\u6B3E\u6765\u7B3C\u7EDC\u4EBA\u5FC3\uFF0C\u5426\u5219\u6388\u4EBA\u4EE5\u67C4\u3002\u73B0\u5728\u7164\u6709\u94B1\u90FD\u4E70\u4E0D\u5230\uFF0C\u800C\u90DD\u6BCD\u53C8\u4E86\u89E3\u5230\u7164\u7684\u6765\u6E90\u548C\u51FA\u5904\uFF0C\u8FD8\u80FD\u5E2E\u52A9\u5468\u79C9\u4E49\u62FF\u5230\u7164\u3002\u5468\u79C9\u4E49\u5BF9\u90DD\u6BCD\u66F4\u52A0\u4F69\u670D\uFF0C\u6CA1\u60F3\u5230\u5979\u7ADF\u7136\u4E86\u89E3\u7684\u90A3\u4E48\u591A\u3002</p>',11),r=[o];function _(n,s){return p(),t("div",null,r)}const h=e(c,[["render",_],["__file","29.html.vue"]]);export{h as default};
